import React, { Component } from "react";
import Expanded from "./Assets/ExpandedInsurence.jpg";
const benefits = [
  { title: "Insurence", count: "10 programs" },
  { title: "Transproting", count: "10 programs" },
  { title: "Sport", count: "10 programs" },
  { title: "Meal", count: "15 programs" },
  { title: "Health", count: "9 programs" },
  { title: "Education", count: "5 programs" },
  { title: "Subscription", count: "12 programs" },
  { title: "For a Children", count: "20 programs" },
];
const programs = {
  Insurence: [
    { title: "Title", img: { Expanded } },
    { title: "Title", img: { Expanded } },
    { title: "Title", img: { Expanded } },
  ],
  Transproting: [
    { title: "Title", img: { Expanded } },
    { title: "Title", img: { Expanded } },
    { title: "Title", img: { Expanded } },
  ],
};
class Benefits extends React.Component {
  render() {
    return (
      <>
        <section className="benefits">
          <h1 className="benefits__title">Company Benefits</h1>
          <div className="benefits__container">
            {benefits.map((benefit, index) => (
              <div key={index} className="benefits__item ">
                <div className="insurance"></div>
                <h1 className="benefits__item__title">
                  {benefit.title}
                  <h4 className="benefits__item__subtitle">{benefit.count}</h4>
                </h1>
              </div>
            ))}
          </div>
        </section>
        <section className="programs">
          {Object.keys(programs).map((key) => (
            <div key={key} className="">
              <h2>{key}</h2>
              {programs[key].map((program, index) => (
                <div key={index} className="program-block">
                  <h3>{program.title}</h3>
                  <img src={program.img.Expanded} alt={program.title} />
                </div>
              ))}
            </div>
          ))}
        </section>
      </>
    );
  }
}

export default Benefits;
